const SET_INITIALIZED = "SET_INITIALIZED"

let initialState = {
    initialized: false
}
const appReducer = (state = initialState, action) => {
    switch (action.type) {
        case SET_INITIALIZED:
            return {
                ...state,
                initialized: true
            }
        default:
            return state
    }
}
const initializedSucces = () => ({type: SET_INITIALIZED})

